  \"2016-07-27T22:55:58.550085\",\n\t\"name\": \"narrative-report-1990-audubon-wetland-management-district-audubon-garrison-wetland-managem\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Audobon
  WMD outlines Refuge accomplishments during the 1990 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  public participation, and compliance with environmental and cultural resource mandates.
  Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, forests, croplands, grasslands,
  grazing, haying, fire management, pest control, and WPA easements. The wildlife
  section of the report discusses endangered and threatened species, waterfowl, marsh
  birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, wildlife
  propagation, and animal control. The public uses of the Refuge described in this
  report include hunting, fishing, trapping, wildlife observation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, computer systems, and energy conservation. Cooperative programs, economic
  uses of the Refuge, and items of interest are provided at the end.\",\n\t\"license_title\":
